import React from 'react'
import "./App.css";
import "./Ending.css";
import { FaGithub, FaLinkedinIn } from 'react-icons/fa';
export default function Ending() {
    return (
        <div className="ending">
            <h1>Thanks for reading!</h1>
            <br/>
            <br/>
            <h3>For More</h3>
            <div>
                <a href="https://github.com/jessechancy"><FaGithub/></a>
                <a href="https://www.linkedin.com/in/jessechancy/"><FaLinkedinIn/></a>
            </div>
        </div>
    )
}
